import React from 'react'
import {  Routes, Route, BrowserRouter } from 'react-router-dom';
import User from './components/User/User';
import Home from './components/Home/Home';

function App() {
  return (

  <BrowserRouter>
    <Routes>
        <Route path='/' element={<Home/>}/>
    </Routes>
  </BrowserRouter>

  )
}

export default App
